import React from "react";
import RowTable from "./RowTable";

export default function Table(props) {
  const item = props.item,
    playerstats = item.playerstats,
    title = item.title,
    points_name = item.name


  return (
    <section>
      <h3>{title}</h3>
      {console.log(playerstats)}
    
      {/* <table>
        {playerstats.map((player_data, key) => (
          <RowTable player_data={player_data} key={key} points_name={points_name}/>
        ))}
      </table> */}
    </section>
  );
}
